package net.yozo.services.front.order.bean;import java.io.Serializable;public class OrderRecordForCustomize extends net.yozo.services.common.Order implements Serializable {	private static final long serialVersionUID = 1L;	private  String nickname;	private  String name;	private  String creatorID;	public String getCreatorID() {		return creatorID;	}	public void setCreatorID(String creatorID) {		this.creatorID = creatorID;	}	public String getNickname() {		return nickname;	}	public void setNickname(String nickname) {		this.nickname = nickname;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}}